def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    sentence = ""
    subject = triples[0].subject

    for i, triple in enumerate(triples):
        if i == 0:
            sentence += f"{subject} {triple.predicate} {triple.object}"
        else:
            if triple.predicate == "league":
                sentence += f", playing in the {triple.object}"
            elif triple.predicate == "manager":
                sentence += f", managed by {triple.object}"
            elif triple.predicate == "birthDate":
                sentence += f", who was born on {triple.object}"
            elif triple.predicate == "birthPlace":
                sentence += f", originally from {triple.object}"
            elif triple.predicate == "currentclub":
                 sentence += f", currently playing for {triple.object}"
            else:
                sentence += f" and their {triple.predicate} is {triple.object}"

    return sentence + "."

